import { ListItemDiv } from "./StatisticsListItem.styled";

export const StatisticsListItemEl = ({ item: { label, percentage } }) => {
  return (
    <ListItemDiv item = {item}>
      <span>{label}</span>
      <span>{percentage}</span>
    </ListItemDiv>
  );
};
